import React, { useEffect, useState } from 'react'
import { Row, Col, Container, Card, CardBody } from 'reactstrap';
import SearchFunc from './Main/SearchFunc';
import SearchStatic from './Main/SearchStatic';

const Main = () => {

  let func = [{
    effect: "혈행흐름개선",
    url : ""
  },{
    effect: "장 건강",
    url : ""
  },{
    effect: "간 건강",
    url : ""
  },{
    effect: "눈 건강",
    url : ""
  },{
    effect: "관절/뼈 건강",
    url : ""
  },{
    effect: "항산화",
    url : ""
  }]
  
  return (
    <div>
      <div>
        <SearchFunc func={func}  />
      </div>
      <div>
        <SearchStatic />
      </div>
    </div>
  )
}

export default Main
